import React, {useEffect} from "react"
import SearchBar from "./SearchBar/SearchBar"
import CountButton from "./CountButton/CountButton"

const products = [
  "tooth paste",
  "tooth brush",
  "mouth wash",
  "dental floss",
  "mouth guard"
]
const App = () => {

    const [productsState, setProductsState] = useStat([])

    useEffect(() => {
        setTimeout(() => {
            setProductsState = [
                "tooth paste",
                "tooth brush",
                "mouth wash",
                "dental floss",
                "mouth guard"
            ]
        },2000)
    },[])

    return (
        <div>
            <SearchBar 
            products={productsState}/>
            {/* <SearchBar products={[
                "hat",
                "gloves",
                "scarf"
            ]}/> */}

            <CountButton incrementBy={1} buttonColor={'blue'}/>
            <CountButton incrementBy={5} buttonColor={'green'}/>
            <CountButton incrementBy={7} buttonColor={'yellow'}/>
        </div>   
    )
}

export default App 

//props is a value that you pass into a component to inform what it does e.g. incrementBy
